void Sound_Init(void){
	DAC_Init();          // Port B is DAC
  Timer1_Init(80000000/11025);	//11.025 kHz
};
//****************Timer1A_Handler***************
//Plays sound effects depending on the *sound
//Input: none
//Output: none
void Timer1A_Handler(void){
	TIMER1_ICR_R = TIMER_ICR_TATOCINT;// acknowledge TIMER1A timeout
  if(SoundCount > 0){ 
		DAC_Out(CurrSound[SoundIndex]);
    SoundIndex += 1;
    SoundCount -= 1;
	}
	else{
		TIMER1_CTL_R = 0x00000000;
	}
}
// **************Sound_Play1*********************
// Start sound output, and set Timer1 periodic interrupts
// Input: the sound array, interrupt period
// Output: none
void Sound_Play1(const unsigned char *sound, uint32_t length){
	CurrSound = sound;						//array of the sound				
	SoundIndex = 0;					//index = 0
	SoundCount = length;		//the length of the sound effect 
	TIMER1_CTL_R = 1;				//enable Timer1
}

void Sound_Rotate(void){
	Sound_Play1(blockrotate, 1740);
};
void Sound_Blockhit(void){
	Sound_Play1(forcehit, 1452);
};
void Sound_Gameover(void){
	Sound_Play1(gameover, 44364);
};
